import { Route } from "react-router-dom";
import { Routes } from "react-router-dom";
import AllMeetUps from "./pages/AllMeetUps";
import Favourites from "./pages/Favourites";
import NewMeetUp from "./pages/NewMeetUp";

function App() {
  return (
    <div>
      <Routes>
        <Route>
          <AllMeetUps />
          <Favourites />
          <NewMeetUp />
        </Route>
      </Routes>
    </div>
  );
}

export default App;
